 import ReactDOM from 'react-dom';
 import './index.css';
 import House from './component/card/house'; //引入App

 /* 加入下面這一段 */
 function App(){
     return(
       <button>大家好</button>
     );
 }
 /* 加入上面這一段 */

 /* 修改div中的東西，改為<App/> */
 ReactDOM.render(
     <div>
         <House name={"日野苑"} price={1500} score={4.3} />
         <House name={"北行旅"} price={1100} score={5.0}/>
         <House name={"台北凱撒"} price={1300} score={4.0}/>
         <House name={"甲山林湯屋"} price={3600} score={4.3}/>
         <House name={"茹曦酒店"} price={3100} score={4.0}/>
     </div>,
     document.getElementById('root')
 );
